package dasar;

public class KelasDuaFor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//Cetak J dua kali Cetak I sekali, sebanyak 3 kali
		for (int i = 0; i < 3; i++) {
			for (int j = 0; j < 2; j++) {
				System.out.print("Cetak J ");
				
			}
			System.out.println("Cetak I ");
		}
	}

}
